                        </div>
                    </div>
                    <div className="userCard">
                        <div className="content">
                            <p>Name:Chegu Manikanta Kumar</p>
                            <p>Age:21years</p>
                            <p>Gender:Male</p>
                            <p>Email:chegu.mani9@gmail.com</p>
                            <p>Mobile No:7330926934</p>
